function update() {
    const pinelement = document.getElementById("pincode");

    const information = data[pinelement.value];
    if (information) {
        document.getElementById("city").value = information.City;
        document.getElementById("state").value = information.State;
    }
    else{
        pinelement.value='';
        document.getElementById("city").value='';
        document.getElementById("state").value='';
    }
}